metadata.description:
Jiyeon got her talisman because she won 3 jackpot in a row. She now has a lot of money like a leprechaun, but she does not really need them with such a powerful talisman as a four-leaf clover.

The uniqueness of clover lies in each petal, which is attributed a special meaning:
the first petal symbolizes the hope for the fulfillment of the most cherished desires;
the second - means faith in a bright future;
the third - brings pure and strong love into a person's life;
the fourth petal gives a person unprecedented luck in all matters.
